import styled from 'styled-components'

export const HomeFixedHeaderComponentWrapper = styled.div`
  .search-icon-wrapper {
    color: var(--dark-dwed);
    display: flex;
    justify-content: center;
    align-items: center;

    svg {
      width: 24px;
      height: 24pxs;
    }
  }
`
